import React from "react";
import "./Footer.css";

const Footer = () => {
  return (
    <>
      <footer>
        <div className="bg-dark">
          <h4 className="  text-white text-center">Showing Pandemic Data</h4>
          <div className="side d-inline text-white">
            Power Rangers SPD duniya ke Rakhwale.
          </div>
        </div>
      </footer>
    </>
  );
};
export default Footer;
